import { useEffect, useState } from "react";
// import { useState } from "react";
import "./App.css";
import "./style.css";
import axios from "axios";

function App() {
  const [items, setItems] = useState([]);
  const [resourceType, setResourceType] = useState("");
  useEffect(() => {
    axios
  }, [resourceType]);
  return (
    <div className="App">
  <div className="container" onClick={() => setResourceType("post1")}>
        POST
      </div>
      <input type="value" id="post1" placeholder="search here..."></input>
      <h1>{resourceType}</h1>
      <>
        {items.map((item) => {
          return <pre>{JSON.stringify(item)}</pre>;
        })}
      </>
     </div>
  );
}

export default App;
